import React from 'react';
import './OurBranch.css'; // Import your CSS file

const Branch = ({ name, image, description }) => {
    return (
        <article>
            <h2>{name}</h2>
            <img src={image} alt={`${name} Branch`} />
            <p>{description}</p>
        </article>
    );
}

const OurBranches = () => {
    return (
        <div>
            <header>
                <h1>Our Branches</h1>
            </header>
            <section className="branch">
                <Branch
                    name="Islamabad Branch"
                    image="data:image/jpeg;base64,"
                    description="Welcome to PGC Gym, Islamabad Branch, your ultimate destination for fitness and wellness in the capital city. Nestled amidst the serene surroundings, our gym offers state-of-the-art facilities and personalized training programs tailored to your fitness goals. Whether you're a fitness enthusiast or a beginner on your wellness journey, our experienced trainers and modern equipment are here to guide you towards a healthier lifestyle."
                />
                <Branch
                    name="Lahore Branch"
                    image="data:image/jpeg;base64,"
                    description="Step into PGC Gym, Lahore Branch, where passion meets perseverance on the path to fitness. Located in the heart of the vibrant city, our gym provides a dynamic environment for individuals of all fitness levels. From high-intensity workouts to rejuvenating yoga sessions, we offer a diverse range of fitness programs to cater to your unique needs. Join our community today and embark on a transformative journey towards a stronger, healthier you."
                />
                <Branch
                    name="Bahawalpur Branch"
                    image="data:image/jpeg;base64,"
                    description="Discover the essence of fitness at PGC Gym, Bahawalpur Branch, where wellness becomes a way of life. Situated in the historical city, our gym combines modern amenities with traditional values to create a holistic fitness experience. With expert guidance and a supportive atmosphere, we empower you to surpass your fitness limits and achieve your goals. Join us at PGC Gym and embrace a healthier, happier lifestyle starting today."
                />
            </section>
            <footer>
                <p>&copy; 2024 Gym Website. All rights reserved.</p>
            </footer>
        </div>
    );
}

export default OurBranches;
